import React from 'react';
import classes from './Meal.module.css';

const Meal = () => {
    return (
        <div className={classes.Meal}>
            <div>
                <img src="/img/meals/1.png"/>
            </div>
            <div>
                <h2>Noodle</h2>
                <p>100% hand-made Noodle, Chewy</p>
                <div>
                    <span>$12.99</span>
                    <div>Count</div>
                </div>
            </div>
        </div>
    );
};

export default Meal;
